define(["jquery.min"],function(){
	function getTime(){
		var e=new Date;
		n=e.getFullYear();
		a=e.getMonth()+1;
		o=e.getDate();
		u=e.getHours();
		i=e.getMinutes();
		ss=e.getSeconds();
		if(a<10){
			a="0"+a;
		}
		if(o<10){
			o="0"+e.getDate();
		}
		if(u<10){
			u="0"+u;
		}
		if(i<10){
			i="0"+i;
		}
		if(ss<10){
			ss="0"+ss;
		}
		g=n+"-"+a+"-"+o+"&nbsp;&nbsp;"+u+":"+i+":"+ss;
		$("#timeNow").html(g);
	}
		getTime();
		//setInterval(getTime, 1000);
	   //setTimeout(getTime, 1000);
});